import React from 'react';
import Main from '../../components/main/Main';

export default props => (
    <Main icon="home" title="Início" subtitle="Sistema para cadastro de usuários" >
        <div className="display-4">Bem Vindo!</div>
        <hr />
        <p className="mb-0">
        Sistema para exemplificar a construção de um cadastro desenvolvido em ReactS
        </p>
  </ Main>
)
